import Footer from './Components/Footer/Footer'

import {BrowserRouter, Routes, Route} from "react-router-dom";

const App = (props) => {
  return (

    <div className="app-wrapper">

    <Header />
    <Lenta />
    <Content contentPageState={props.state.contentPageState} addMessage={props.addMessage} />
   <Footer />


    </div>
  );
}

export default App;
